import React from "react";
import { Link, useHistory } from 'react-router-dom';

const Render = () => {
    const history = useHistory();
    console.log(history.location)
    return (
        <div>
            <div className='flex flex-col justify-start text-lg p-8 min-h-screen'>
                <div className='text-4xl font-bold leading-normal mb-4'>thanks for joining!</div>
                <img src={require('../media/welcome.gif').default} alt='meme' className='w-full object-cover mb-8'/>
                <div className='mb-4'>After you're application is reviewed you will be emailed an invite link which you can use to join the groupchat.</div>
                <div className='mb-4'>You can read more about our selection process here.</div>
            </div>
        </div>
    )
}

export default Render

